import React from "react";
import Aside from "../../aside";
import veiculos from "../veiculos.json"

export default function CheckboxFilter({
  style,
  setVeiculos,
  automoveis,
  filtrarVeiculos,
}) {
  return (
    <div className={style.filtro}>
      {automoveis.map((marca) => (
        <Aside marca={marca} onClick={() => filtrarVeiculos(marca)}> {marca} </Aside>
      ))}
      <input onClick={() => setVeiculos(veiculos)}>Todos</input>
    </div>
  );
}
